import Pools from '../../assets/tulip/pools.svg'
import Staked from '../../assets/tulip/staked.svg'
import Wallet from '../../assets/tulip/wallet.svg'

function AssetList() {
  return (
    <div
      css={`
        display: flex;
        flex-direction: column;
        padding: ${2 * GU}px;
      `}
    >
      <div
        css={`
          display: flex;
          flex-direction: row;
          justify-content: space-between;
